import React from "react";
import ReactDOM from "react-dom";
import Home from "./Home";

class App extends React.Component {
  state = {
    banner: "Welcome Message",
  };
  changeHeader = () => {
    this.setState({ header: "Have a Good Time!" });
  };

  render() {
    return (
      <div>
        <Home />
      </div>
    );
  }
}

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
